function vipConfirm() {
    let e = $("#vip-confirm-form");
    e.submit(function (t) {
        t.preventDefault();
        let n = $(this).attr("action"),
            i = e.find($("input[name=phone]")).val();
        if (!phone_regex.test(i))
            return (
                toastr.error(
                    "S in thoi bn nhp khng ng nh dng"
                ),
                e.find($("input[name=phone]")).focus(),
                !1
            );
        $.ajax({
            url: n,
            type: "POST",
            data: e.serialize(),
        })
            .done(function (t) {
                toastr.success(t.message),
                    e
                        .find(
                            "input[type=text], input[type=tel], input[type=email], textarea, select"
                        )
                        .val(""),
                    setTimeout(function () {
                        $.fancybox.close();
                    }, 500);
            })
            .fail(function (e) {
                let t = $.parseJSON(e.responseText);
                $.each(t, function (e, t) {
                    toastr.error(t);
                });
            });
    });
}

function fbLogin() {
    FB.login(
        function (e) {
            e.authResponse
                ? (console.log("Welcome!  Fetching your information.... "),
                  FB.api(
                      "/me",
                      {
                          fields: "id,name,email,birthday,gender",
                      },
                      function (e) {
                          $.ajax({
                              type: "POST",
                              url: "login-facebook",
                              data: {
                                  id: e.id,
                                  email: e.email,
                                  name: e.name,
                                  gender: e.gender,
                                  birthday: e.birthday,
                              },
                              success: function (e) {
                                  window.location.href = e;
                              },
                          });
                      }
                  ))
                : console.log(
                      "User cancelled login or did not fully authorize."
                  );
        },
        {
            scope: "email,user_birthday",
        }
    );
}

