function ajaxCall(e, t, n, i) {
    $.ajax({
        type: e,
        url: t,
        data: n,
    })
        .done(i)
        .fail(function (e) {
            let t = $.parseJSON(e.responseText);
            $.each(t, function (e, t) {
                toastr.error(t);
            });
        })
        .always(function () {});
}
